    const data = [{Category: "home_tutions"},{Category: "online"},{Category: "in_person"}]

    return (
       <Fragment>
            <h1>Filter</h1>
            <h2>Filter Tutors</h2>
            <div id="filters">
                {
                    data.map((filterOptions) => <label>
                        <input type="checkbox" value={filterOptions.Category}/>
